import React from 'react';
import './stylesheet.css';
import logo from './images/sf_images/seefood_logo_dark.png';

function navBar() {
  return (
    <nav>
      <div className="navbar">
        <ul class="nav-left">
          <li><img src={logo} alt="" /></li>
          <li><a href="index.html">home</a></li>
          <li><a href="restaurants.html">restaurants</a></li>
          <li><a href="about.html">about</a></li>
        </ul>
        <ul className="nav-right">
          <li>english</li>
          <li><a href="https://twitter.com/SeeFood_app" target="_blank"><i class="fab fa-twitter"></i></a></li>
          <li><a href="https://www.facebook.com/SeeFoodApplication/" target="_blank"><i
            class="fab fa-facebook"></i></a></li>
          <li><a href="https://www.instagram.com/seefood_app/?hl=en" target="_blank"><i
            class="fab fa-instagram"></i></a></li>
        </ul>
      </div>
    </nav>
  );
}

export default App;
